    {
        var pipeSourceParametersResult = CreatePipeSourceParameters();
        factoryAction?.Invoke(pipeSourceParametersResult);

        return pipeSourceParametersResult;
    }

    private Humidifier.Pipes.PipeTypes.PipeSourceParameters CreatePipeSourceParameters()
    {
        var pipeSourceParametersResult = new Humidifier.Pipes.PipeTypes.PipeSourceParameters();

