    {
        base.CreateChildren(result);

        result.ManagedStreamingKafkaParameters ??= ManagedStreamingKafkaParametersFactory?.Build();
        result.DynamoDBStreamParameters ??= DynamoDBStreamParametersFactory?.Build();
        result.SelfManagedKafkaParameters ??= SelfManagedKafkaParametersFactory?.Build();
        result.RabbitMQBrokerParameters ??= RabbitMQBrokerParametersFactory?.Build();
        result.SqsQueueParameters ??= SqsQueueParametersFactory?.Build();
        result.KinesisStreamParameters ??= KinesisStreamParametersFactory?.Build();
        result.FilterCriteria ??= FilterCriteriaFactory?.Build();
        result.ActiveMQBrokerParameters ??= ActiveMQBrokerParametersFactory?.Build();
    }

